import React from "react";
import "./style.css";

function NavBar(props) {
  return (
    <nav className="navbar sticky-top">
      <h2>
        <ul className="nav">
          <li>
            <a href="#">Click Game</a> 
        </li>
          <li>
            Click picture to begin
        </li>
          <li>
            Contact
        </li>
        </ul>
      </h2>

    </nav>
  );
}

export default NavBar;
